{"csharp.json":"{
	// Place your snippets for csharp here. Each snippet is defined under a snippet name and has a prefix, body and 
	// description. The prefix is what is used to trigger the snippet and the body will be expanded and inserted. Possible variables are:
	// $1, $2 for tab stops, $0 for the final cursor position, and ${1:label}, ${2:another} for placeholders. Placeholders with the 
	// same ids are connected.
	// Example:
	// "Print to console": {
	// 	"prefix": "log",
	// 	"body": [
	// 		"console.log('$1');",
	// 		"$2"
	// 	],
	// 	"description": "Log output to console"
	// }
	"WriteLine to console": {
		"prefix": "cw",
		"body": [
			"Console.WriteLine($1);",
			"$2"
		],
		"description": "WriteLine output to console"
	},
	"Create a constructor": {
		"prefix": "ctor",
		"body": [
			"public $TM_FILENAME_BASE($1)",
			"{",
			"$0",
			"}"
		],
		"description": "Create a constructor"
	},
	"Create a property": {
		"prefix": "prop",
		"body": [
			"public $1 $2 { get; set; }",
			"$0"
		],
		"description": "Create a property"
	},
	"Create a method": {
		"prefix": "method",
		"body": [
			"public $1 $2($3)",
			"{",
			"$0",
			"}"
		],
		"description": "Create a method"
	},
	"Create a class": {
		"prefix": "class",
		"body": [
			"public class $1",
			"{",
			"$0",
			"}"
		],
		"description": "Create a class"
	},
	"Create a struct": {
		"prefix": "struct",
		"body": [
			"public struct $1",
			"{",
			"$0",
			"}"
		],
		"description": "Create a struct"
	},
	"Create a interface": {
		"prefix": "interface",
		"body": [
			"public interface $1",
			"{",
			"$0",
			"}"
		],
		"description": "Create a interface"
	},
	"Create a enum": {
		"prefix": "enum",
		"body": [
			"public enum $1",
			"{",
			"$0",
			"}"
		],
		"description": "Create a enum"
	}
}"}
